(4, ' How do I get started?', 'Get Start <a href=\"https://rixero.com/demo/login\">Click here</a>', 1, '2022-11-08 10:45:54'),
(5, ' What services does Rixero offer?', '', 1, '2022-11-08 10:46:17'),
(6, ' How much will it cost?', '', 1, '2022-11-08 10:46:24'),
(8, ' How soon will I get my designs?', 'Graphics will be delivered within 24 hours. Additional time will be taken for any changes that are required.', 1, '2022-11-08 10:47:07'),
(9, ' How do I pick a designer?', 'Rixero simplifies the process by matching you with the most suitable designer for your needs.', 1, '2022-11-08 10:47:24'),
(10, ' What if I dont like the design?', 'You can get up to 3 revisions for each design.', 1, '2022-11-08 10:47:47'),
(11, ' What are RixiCoins?', 'RixiCoins are our in-platform tokens, which can be redeemed for various purposes', 1, '2022-11-08 10:48:07');
